import { clearHistoryActionCreator } from '../actions'

class History extends React.Component {

    myMethod = () => {
        console.log(this.props.history)
    }

    componentDidMount() {
        console.log("component mounted")
    }

    componentDidUpdate() {
        console.log("history updated")
    }

    oldrender() {
        this.myMethod()
        console.log(this.props)
        return (
            <div>
                history
                {this.props.history.map(item => {return (<div></div>)})}
            </div>
        )
    }

    render() {
        this.myMethod()
        console.log(this.props)
        return (
            <div>
                history
                {this.props.history}
            </div>
        )
    }
}

const mapStateToProps = state => {
    return {history: state.histoyReducer}
}

export default connect(mapStateToProps, {clearHistoryActionCreator: clearHistoryActionCreator})(History)
